import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class CardDetails extends Component{
	render(){
		const {match} = this.props;
		console.log(match);
		return(
			<h1>
				Details
			</h1>
		)
	}
}
export default CardDetails;
